					InitDataProperty(0, cnt++, dtData, 60, daCenter, true, "hngr_bar_use_flg", false, "", dfNone, 0, true, true);                                                                                                                                                                                                                                                                                                                   
					InitDataProperty(0, cnt++, dtData, 60, daCenter, true, "sub_trd_use_flg", false, "", dfNone, 0, true, true);                                                                                                                                                                                                                                                                                                                    
