	/**                                                                                                                                                                                                                                                                                                                                                                                                                                                             
     * OnKeyPress시 호출되는 function <br>                                                                                                                                                                                                                                                                                                                                                                                                                              
     * HTML Control의 onkeypress 이벤트에서 해당 key만 입력되게 한다. <br>                                                                                                                                                                                                                                                                                                                                                                                              
     * <br><b>Example :</b>                                                                                                                                                                                                                                                                                                                                                                                                                                             
     * <pre>                                                                                                                                                                                                                                                                                                                                                                                                                                                            
     *	                                                                                                                                                                                                                                                                                                                                                                                                                                                                
     * </pre>                                                                                                                                                                                                                                                                                                                                                                                                                                                           
     * @return 없음                                                                                                                                                                                                                                                                                                                                                                                                                                                     
     * @author 김재연                                                                                                                                                                                                                                                                                                                                                                                                                                                   
     * @version 2009.06.04                                                                                                                                                                                                                                                                                                                                                                                                                                              
     */                                                                                                                                                                                                                                                                                                                                                                                                                                                                 
	function obj_keypress() {                                                                                                                                                                                                                                                                                                                                                                                                                                       
		                                                                                                                                                                                                                                                                                                                                                                                                                                                        
		switch (event.srcElement.dataformat) {                                                                                                                                                                                                                                                                                                                                                                                                                  
		                                                                                                                                                                                                                                                                                                                                                                                                                                                        
			case "int":                                                                                                                                                                                                                                                                                                                                                                                                                                     
				ComKeyOnlyNumber(event.srcElement); //숫자 만입력하기                                                                                                                                                                                                                                                                                                                                                                                   
				break;                                                                                                                                                                                                                                                                                                                                                                                                                                  
		                                                                                                                                                                                                                                                                                                                                                                                                                                                        
			case "float":                                                                                                                                                                                                                                                                                                                                                                                                                                   
				ComKeyOnlyNumber(event.srcElement, "."); //숫자+"."입력하기                                                                                                                                                                                                                                                                                                                                                                             
				break;                                                                                                                                                                                                                                                                                                                                                                                                                                  
		                                                                                                                                                                                                                                                                                                                                                                                                                                                        
			case "eng":                                                                                                                                                                                                                                                                                                                                                                                                                                     
				ComKeyOnlyAlphabet('upper'); //영문 대문자만입력하기                                                                                                                                                                                                                                                                                                                                                                                    
				break;                                                                                                                                                                                                                                                                                                                                                                                                                                  
				                                                                                                                                                                                                                                                                                                                                                                                                                                        
			case "uppernum":                                                                                                                                                                                                                                                                                                                                                                                                                                
				ComKeyOnlyAlphabet('uppernum'); //영문 대문자만입력하기                                                                                                                                                                                                                                                                                                                                                                                 
				break;                                                                                                                                                                                                                                                                                                                                                                                                                                  
		                                                                                                                                                                                                                                                                                                                                                                                                                                                        
			default:                                                                                                                                                                                                                                                                                                                                                                                                                                        
				ComKeyOnlyNumber(event.srcElement); //숫자만입력하기                                                                                                                                                                                                                                                                                                                                                                                    
		}                                                                                                                                                                                                                                                                                                                                                                                                                                                       
	}                                                                                                                                                                                                                                                                                                                                                                                                                                                               
	                                                                                                                                                                                                                                                                                                                                                                                                                                                                
    /**                                                                                                                                                                                                                                                                                                                                                                                                                                                                 
     * OnBlur시 호출되는 function <br>                                                                                                                                                                                                                                                                                                                                                                                                                                  
     * HTML Control의 onblur 이벤트에서 유효성 확인한다. <br>                                                                                                                                                                                                                                                                                                                                                                                                           
     * <br><b>Example :</b>                                                                                                                                                                                                                                                                                                                                                                                                                                             
     * <pre>                                                                                                                                                                                                                                                                                                                                                                                                                                                            
     *	                                                                                                                                                                                                                                                                                                                                                                                                                                                                
     * </pre>                                                                                                                                                                                                                                                                                                                                                                                                                                                           
     * @return 없음                                                                                                                                                                                                                                                                                                                                                                                                                                                     
     * @author 김재연                                                                                                                                                                                                                                                                                                                                                                                                                                                   
     * @version 2009.06.04                                                                                                                                                                                                                                                                                                                                                                                                                                              
     */                                                                                                                                                                                                                                                                                                                                                                                                                                                                 
