	/**                                                                                                                                                                                                                                                                                                                                                                                                                                                             
     * check 해제시 확인 메세지를 보여주는 function <br>                                                                                                                                                                                                                                                                                                                                                                                                                
     * <br><b>Example :</b>                                                                                                                                                                                                                                                                                                                                                                                                                                             
     * <pre>                                                                                                                                                                                                                                                                                                                                                                                                                                                            
     *    checkConfirm("por_use_flg", event.srcElement.checked);                                                                                                                                                                                                                                                                                                                                                                                                        
     * </pre>                                                                                                                                                                                                                                                                                                                                                                                                                                                           
     * @param {object} formObjName HTML form 오브젝트 명                                                                                                                                                                                                                                                                                                                                                                                                                
     * @param {object} isCheck check 여부                                                                                                                                                                                                                                                                                                                                                                                                                               
     * @return 없음                                                                                                                                                                                                                                                                                                                                                                                                                                                     
     * @author 김재연                                                                                                                                                                                                                                                                                                                                                                                                                                                   
     * @version 2009.06.04                                                                                                                                                                                                                                                                                                                                                                                                                                              
     */                                                                                                                                                                                                                                                                                                                                                                                                                                                                 
	function checkConfirm(formObjName, isCheck) {    
		var array ;                                                                                                                                                                                                                                                                                                                                                                                                                                             
		if( !(formObjName  instanceof Array ) ) {                                                                                                                                                                                                                                                                                                                                                                                                               
			array = new Array(formObjName); 
		}else{                                                                                                                                                                                                                                                                                                                                                                                                                                                  
			array = formObjName;                                                                                                                                                                                                                                                                                                                                                                                                                            
		}                                                                                                                                                                                                                                                                                                                                                                                                                                                       
		                                                                                                                                                                                                                                                                                                                                                                                                                                                        
		if(!isCheck) { //체크가 해제되었다면                                                                                                                                                                                                                                                                                                                                                                                                                    
			var bConfirm = ComShowCodeConfirm('PRI02001');      
			for(var i = 0 ; i < array.length ; i++ ){                                                                                                                                                                                                                                                                                                                                                                                                       
				var objName = eval("form." + array[i]);      
				objName.checked = !bConfirm;                                                                                                                                                                                                                                                                                                                                                                                                            
			}                                                                                                                                                                                                                                                                                                                                                                                                                                               
		}                                                                                                                                                                                                                                                                                                                                                                                                                                                       
	}                                                                                                                                                                                                                                                                                                                                                                                                                                                               
                                                                                                                                                                                                                                                                                                                                                                                                                                                                        
	                                                                                                                                                                                                                                                                                                                                                                                                                                                                
